let tableData = {},
    pieChartData = [],
    LineChartData = [];

const defaultDataProcessing = (data, date) => {

    let rawdata = data.data.data,
        dafaultData = rawdata.filter( data => data.date === 'date' );
    debugger;


}


export default defaultDataProcessing;
